import React from "react"

import * as propTypes from "prop-types";

export const BookList = (
  {
    bookName,
    onShop
  }) => {

  return (
    <div onClick={onShop}>
      {bookName}
    </div>
  )
}

BookList.defaultProps = {
  bookName: "React design pattern"
}

BookList.propTypes = {
  bookName: propTypes.string
}
